const puppeteer = require('puppeteer')

const generateCertificate = async ({ name, date, course }) => {
	const browser = await puppeteer.launch({
		executablePath: '/usr/bin/chromium-browser',
	})
	const page = await browser.newPage()

	await page.setContent(`
    <html lang="en">
    <head>
        <style>
            body {
                width: 1760px;
                height: 1200px;
                margin: 0;
                padding: 0;
                background-color: #fff;
                font-family: 'Times New Roman', Times, serif;
            }
    
    
            /* latin */
            @font-face {
                font-family: 'Whisper';
                font-style: normal;
                font-weight: 100;
                src: url(data:font/woff2;base64,) format('woff2');
                unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+0304, U+0308, U+0329, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
            }
    
            .container {
                width: 1760px;
                height: 1200px;
                position: relative;
                background-image: url('data:image/jpeg;base64,');
    
            }
    
            .text-name {
                position: absolute;
                top: 52%;
                left: 50%;
                transform: translate(-50%, -50%);
                font-size: 80px;
                font-weight: 700;
                color: #fff;
                text-align: center;
                width: 100%;
                font-family: 'Whisper'
            }
    
            .text-date {
                position: absolute;
                top: 86%;
                left: 30%;
                transform: translate(-50%, -50%);
                font-size: 20px;
                font-weight: 700;
                color: #fff;
                text-transform: uppercase;
                text-align: center;
                width: 100%;
                font-family: 'Whisper'
            }
    
            .text-desc {
                position: absolute;
                max-width: 900px;
                top: 70%;
                left: 50%;
                transform: translate(-50%, -50%);
                font-size: 36px;
                font-weight: 300;
                color: #fff;
                text-align: center;
                width: 100%;
                font-family: 'Whisper'
            }
            .text-bold{
                font-weight: 500;
            }
        </style>
    </head>
    
    <body>
        <div class="container">
            <p class="text-name">${name}</p>
            <p class="text-date">${date}</p>
            <p class="text-desc">This certificate is awarded in recognition of the dedication, commitment, and outstanding
                performance demonstrated by him/her throughout the duration of the course named "${course}".</p>
        </div>
    
    </body>
    
    </html>
          `)

	await page.setViewport({ width: 1760, height: 1200 })
	const screenshotBuffer = await page.screenshot()
	await browser.close()

	return screenshotBuffer
}
module.exports = { generateCertificate }
